// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract VoteContract {
    struct Candidate {
        uint id;
        string name;
        uint voteCount;
    }

    struct Elector {  // Remplace "Voter" par "Elector"
        bool hasVoted;
        uint voteCandidateId;
    }

    struct Election {
        uint id;
        string name;
        bool isClosed;
        uint[] candidateIds; // IDs des candidats associs  cette lection
    }

    struct VoteRecord {
        address voter;
        uint candidateId;
    }

    address public admin;
    uint public candidatesCount;
    uint public electionsCount;
    bool public votingOpen;

    mapping(uint => Candidate) public candidates;
    mapping(address => Elector) public electors;  // Remplace "voters" par "electors"
    mapping(uint => Election) public elections;

    VoteRecord[] public voteAuditTrail;

    event CandidateAdded(uint id, string name);
    event ElectionCreated(uint id, string name);
    event CandidateAssociatedToElection(uint electionId, uint candidateId);
    event VoteCast(address voter, uint candidateId);
    event VotingClosed();
    event VotingOpened();
    event ResultsPublished(string winnerName, uint winnerVoteCount);

    constructor() {
        admin = msg.sender;
    }

    modifier onlyAdmin() {
        require(msg.sender == admin, "Only admin can perform this action");
        _;
    }

    modifier isVotingOpen() {
        require(votingOpen, "Voting is closed");
        _;
    }

    // Ajouter un candidat globalement (hors lection)
    function addCandidate(string memory _name) public onlyAdmin {
        candidatesCount++;
        candidates[candidatesCount] = Candidate(candidatesCount, _name, 0);
        emit CandidateAdded(candidatesCount, _name);
    }

    // Crer une lection
    function createElection(string memory _name) public onlyAdmin returns (uint) {
        electionsCount++;
        Election storage newElection = elections[electionsCount];
        newElection.id = electionsCount;
        newElection.name = _name;
        newElection.isClosed = true;

        emit ElectionCreated(electionsCount, _name);
        return electionsCount;
    }

    // Associer un candidat existant  une lection
    function addCandidateToElection(uint _electionId, uint _candidateId) public onlyAdmin {
        require(elections[_electionId].id != 0, "Election not found");
        require(candidates[_candidateId].id != 0, "Candidate not found");

        elections[_electionId].candidateIds.push(_candidateId);
        emit CandidateAssociatedToElection(_electionId, _candidateId);
    }

    // Ouvrir le vote
    function openVoting(uint _electionId) public onlyAdmin {
        require(elections[_electionId].isClosed == true, "Voting is already open");
        elections[_electionId].isClosed = false;
        emit VotingOpened();
    }

    // Fermer le vote
    function closeVoting(uint _electionId) public onlyAdmin {
        require(elections[_electionId].isClosed == false, "Election is already closed");
        elections[_electionId].isClosed = true;
        emit VotingClosed();
    }

    // Voter pour un candidat
    function vote(uint _candidateId) public isVotingOpen {
        require(!electors[msg.sender].hasVoted, "You have already voted");  // Remplace "voters" par "electors"
        require(_candidateId > 0 && _candidateId <= candidatesCount, "Invalid candidate");

        electors[msg.sender] = Elector(true, _candidateId);  // Remplace "Voter" par "Elector"
        candidates[_candidateId].voteCount++;

        voteAuditTrail.push(VoteRecord(msg.sender, _candidateId));

        emit VoteCast(msg.sender, _candidateId);
    }

    // Rcuprer le gagnant de l'lection
    function getWinner(uint electionId) public returns (string memory winnerName, uint winnerVoteCount) {
        require(!votingOpen, "Voting is still ongoing");
        require(elections[electionId].id != 0, "Election not found");

        uint winningVoteCount = 0;
        uint winnerId = 0;

        for (uint i = 0; i < elections[electionId].candidateIds.length; i++) {
            uint candidateId = elections[electionId].candidateIds[i];
            if (candidates[candidateId].voteCount > winningVoteCount) {
                winningVoteCount = candidates[candidateId].voteCount;
                winnerId = candidateId;
            }
        }

        winnerName = candidates[winnerId].name;
        winnerVoteCount = candidates[winnerId].voteCount;

        emit ResultsPublished(winnerName, winnerVoteCount);
    }

    // Rcuprer les votes enregistrs (audit)
    function getVoteAuditTrail() public view returns (VoteRecord[] memory) {
        return voteAuditTrail;
    }
}
